import LogoutButton from '../Logout/LogoutButton.js';
import Courses from '../Courses/Courses.js';
import { NavLink } from 'react-router-dom';

import React from 'react';

const NavigationBar = () => {
    return (
        <div>
            <ul>
                <li>Home</li>
                <li>Courses</li>
                <li>Course Details</li>
                <li>Pick a Course</li>
                <li>Login/Logout</li>
            </ul>
        </div>
    );
};

export default NavigationBar;
